// SPDX-License-Identifier: MIT
pragma solidity ^0.8.16;

import {VRFConsumerBase} from "@bisonai/orakl-contracts/v0.1/src/VRFConsumerBase.sol";
import {IVRFCoordinator} from "@bisonai/orakl-contracts/v0.1/src/interfaces/IVRFCoordinator.sol";

contract VRFConsumer is VRFConsumerBase {
    uint256[] public sRandomWords;
    address private diamondContract;
    address private sOwner;

    IVRFCoordinator COORDINATOR;

    modifier onlyOwner() {
        require(
            msg.sender == sOwner || msg.sender == diamondContract,
            "not owner"
        );
        _;
    }

    constructor(
        address coordinator,
        address _diamond
    ) VRFConsumerBase(coordinator) {
        sOwner = msg.sender;
        COORDINATOR = IVRFCoordinator(coordinator);
        diamondContract = _diamond;
    }

    // Receive remaining payment from requestRandomWordsPayment
    receive() external payable {}

    function requestRandomWords(
        bytes32 keyHash,
        uint64 accId,
        uint32 callbackGasLimit,
        uint32 numWords
    ) public onlyOwner returns (uint256 requestId) {
        requestId = COORDINATOR.requestRandomWords(
            keyHash,
            accId,
            callbackGasLimit,
            numWords
        );
    }

    function fulfillRandomWords(
        uint256 /* requestId */,
        uint256[] memory randomWords
    ) internal override {
        sRandomWords = randomWords;
    }

    function VRFCall(
        bytes32 keyHash,
        uint64 accId,
        uint32 callbackGasLimit,
        uint32 numWords
    ) public onlyOwner {
        requestRandomWords(keyHash, accId, callbackGasLimit, numWords);
    }

    function getLastRandomWords(
        uint _min,
        uint _max
    ) public view returns (uint256[] memory) {
        uint256[] memory randomWords = new uint256[](sRandomWords.length);
        for (uint i = 0; i < sRandomWords.length; i++) {
            randomWords[i] = (sRandomWords[i] % _max) + _min;
        }

        return randomWords;
    }
}

